import React from 'react';
import { FormControl, InputLabel, Select, MenuItem, Paper, Typography } from '@mui/material';

const ModelSelection = ({ selectedModel, onModelChange }) => {
  return (
    <Paper sx={{ p: 3, mb: 3 }}>
      <Typography variant="h6" gutterBottom>
        Modellauswahl
      </Typography>
      <FormControl fullWidth>
        <InputLabel>Vorhersagemodell</InputLabel>
        <Select
          value={selectedModel}
          onChange={(e) => onModelChange(e.target.value)}
          label="Vorhersagemodell"
        >
          <MenuItem value="gru">GRU (Gated Recurrent Unit)</MenuItem>
          <MenuItem value="tft">TFT (Temporal Fusion Transformer)</MenuItem>
          <MenuItem value="xgboost">XGBoost</MenuItem>
        </Select>
      </FormControl>
    </Paper>
  );
};

export default ModelSelection;
